import React, { Component, Fragment } from 'react';
import { Navbar, NavbarBrand, NavbarToggler, Collapse, Nav, NavItem, NavLink } from 'reactstrap'

class Header extends Component {
    constructor(props) {
        super(props);
        this.state = {
            isOpen: false
        }
    }
    toogleNavbar = () => {
        this.setState({ isOpen: !this.state.isOpen });
    }
    render() {
        const { isOpen } = this.state
        return (
            <Fragment>
                <Navbar dark color="dark">
                    <NavbarBrand href="/" className="mr-auto">Music Library</NavbarBrand>
                    <NavbarToggler onClick={this.toogleNavbar} className="mr-2 d-sm-none" />
                    <Collapse isOpen={isOpen} navbar>
                        <Nav navbar>
                            <NavItem>
                                <NavLink href="/genres" >Genre</NavLink>
                            </NavItem>
                            <NavItem>
                                <NavLink href="/albums">Album</NavLink>
                            </NavItem>
                            <NavItem>
                                <NavLink href="/artists">Artist</NavLink>
                            </NavItem>
                            <NavItem>
                                <NavLink href="/songs">Song</NavLink>
                            </NavItem>
                        </Nav>
                    </Collapse>

                </Navbar>
            </Fragment>
        )
    }
}

export default Header;
